            if grid[i][j] == 'O':
                if (grid[i - 1][j] == 'X' or i == 0) and (grid[i + -1][j] == 'X' or i == rows - 1) and (grid[i][j - 1] == 'X' or j == 0) and (grid[i][j + 1] == 'X' or j == cols - 1):
                    count += 1
    return count
